import React, { useState } from "react";
import { Button, Modal } from "@mui/material";

const StateModal = ({ open, handelStateModalClose, selectItem }) => {
  return (
    <Modal
      open={open}
      style={{
        height: "100%",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          background: "white",
          height: 150,
          width: 350,
          padding: 10,
          borderRadius: 10,
          display: "flex",
          flexDirection: "column",
        }}
      >
        <div style={{ flex: 8 }}>
          <h3 style={{ color: "red" }}>Do You Want To Exit From {item.name}</h3>
          <p>{selectItem}</p>
        </div>
        <div style={{ flex: 2, display: "flex", gap: 10 }}>
          <Button
            style={{
              color: "white",
              background: "gray",
            }}
            onClick={handelStateModalClose}
          >
            YES
          </Button>
          <Button
            style={{
              color: "white",
              background: "gray",
            }}
            onClick={handelStateModalClose}
          >
            NO
          </Button>
        </div>

        {/* {item.map((items, i) => {
          console.log(items);
          return <p>{("tete", items.name)}</p>;
        })} */}
      </div>
    </Modal>
  );
};
export default StateModal;
